import React from 'react'
import '../index.css'
import BuchenLogic from './buchenLogic';


export default class Zimmer extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      zimmername: props.zimmername,
      standort: props.standort,
      stockwerk: props.stockwerk,
      maxP: props.maxP,
      showModal: true
    };
  }

  render() {
    
    return (
      <div className='buchen-main'>
        <h1>hallo</h1>
        <button className='closePopUp' onClick={() => this.setState({showModal: this.state.showModal = false})}>Close Buchung</button>
        
        </div>
    )
  }

}
